import SearchFocus from './SearchFocus'

export default {
  components: {
    SearchFocus,
  },
  created() {
  },
  data() {
    return {
      searchTerm: '',
    }
  },
  computed: {
    searchResults () {
      const searchTerm = this.searchTerm
      if (searchTerm.length < 3) return []
      return this.$search.search({ query: searchTerm, limit: 5, suggest: true })
    },
  },
  watch: {
    $route (to, from) {
      this.searchTerm = ''
    }
  },
  methods: {
    reset() {
      this.searchTerm = ''
    },
  }
}
